    const { loading, categories, getCategories } = useCategory();
    console.log(categories);

    useEffect(() => getCategories(), []);
  return (
    <>
        <HeaderPage 
            title="Categorías"
            btnTitle="Nueva categoría"
        />
        {loading}
    </>
  )
}
